import React from "react";
import Estilo from "../Hojas de Estilos/Inicio.css"
function Inicio(){
    return(
        <article className="contenedor-inicio">
            <h1 className="eslogan-texto"><i>Creando nuevos futuros</i></h1>
            <img src="" className="eslogan-imagen"/>
        </article>
    );
}

export default Inicio;
